;; @@
(def back-ch (chan 3e4))
(def trad-rbm (train-cd (create-theoretical-rbm 9 10)
          bars
          :epochs 10000
          :init-learning-rate 0.01
          :learning-rate-fn (fn [i s] i)
          :back-ch back-ch))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;small-bars/trad-rbm</span>","value":"#'small-bars/trad-rbm"}
;; <=

;; @@
(async/close! back-ch)
(def history (<!? (async/into [] back-ch)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;small-bars/history</span>","value":"#'small-bars/history"}
;; <=

;; @@
(def trad-weight-traces (take-nth 100 (map (comp flatten first) history)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;small-bars/trad-weight-traces</span>","value":"#'small-bars/trad-weight-traces"}
;; <=

;; @@
(do (apply plot/compose 
       (map #(plot/list-plot %1 :color %2 :joined true
                             :plot-range [[0 300] [-4 5]] :plot-size 800)
       (mat/transpose trad-weight-traces)
       (cycle ["red" "green" "blue" "orange" "brown" "black" "grey" "orange" "pink" "yellow"]))))
